import { Job } from '../entities/Job';
import JobComponent from './JobItem';

interface IJobList {
  allJobs: Job[];
}

const JobList = ({ allJobs }: IJobList) => {
  return (
    <ul>
      {allJobs.length > 0 ? 'The relevant jobs are:' : ''}
      {allJobs.map((job, index) => (
        <JobComponent key={index} job={job}></JobComponent>
      ))}
    </ul>
  );
};

export default JobList;
